import React from 'react';
import { Card } from 'antd';
import WholePro from '../WholePro';

class WholeProCard extends React.Component {
    render() {
        return (
            <Card style={{ width: 300 }}>
                <p>Progress for all lands</p>
                <WholePro/>
            </Card>
        );
    }
}

export default WholeProCard;
